import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';
import Cookies from 'js-cookie';

const Header = () => {
  const isLoggedIn = !!Cookies.get('email'); // if email cookie exists

  return (
    <header className="header">
      <h1 className="title">Finique</h1>
      <nav className="nav">
        <ul>
          <li>Services</li>
          <li>About us</li>
          {!isLoggedIn && (
            <li>
              <Link to="/signup">
                <button className="sign-up-button">Sign Up</button>
              </Link>
            </li>
          )}
        </ul>
      </nav>
    </header>
  );
};

export default Header;
